  {storeItems.map((item)=>( <div className='bg-slate-900 text-white border-2 rounded-lg p-10' key={item.id}>
    <h2 className='text-center text-xl font-bold underline'>{item.name}</h2>
    <p> name: {item.name}</p>
    <p> price: {tax ? item.price * (1 + tax) : item.price}</p>

  </div>  ))}



</div>

  )
}

export default CardStore
